import { Form } from "react-router-dom";

const FilterSearch = () => {
  return (
    <Form method="GET" action="/movies">
      <div className="filter-search">
        <div className="search-bar">
          <input
            type="text"
            name="search"
            id="search"
            autoComplete="off"
            placeholder="Search for movie..."
          />
          <button>Search</button>
        </div>

      </div>
    </Form>
  );
};

export default FilterSearch;
